// import React from "react";
// const Header=()=>{
//     return(
//         <div>Hellowww</div>
//     )
// };
// export default Header;

import React from "react";
import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/css";
import "swiper/css/navigation";
import "swiper/css/pagination";
import "swiper/css/autoplay";
import { Navigation, Pagination, Autoplay } from "swiper/modules";

const Header = () => {
    return (
      <div className="bg-gray-100 text-gray-900">
        <div className="max-w-sm mx-auto bg-white shadow-xl rounded-lg overflow-hidden mt-8 fade-in transform transition duration-500 hover:scale-105">
          {/* Profile Image */}
          <div className="bg-gradient-to-r from-teal-500 to-blue-500 p-4">
            <img
              src="https://via.placeholder.com/150"
              alt="Profile"
              className="w-24 h-24 rounded-full mx-auto border-4 border-gray-900"
            />
          </div>
  
          {/* Name */}
          <div className="text-center mt-4">
            <h1 className="text-3xl font-bold text-gray-900">John Doe</h1>
            <p className="text-gray-500 italic">
              "Crafting digital dreams into reality"
            </p>
          </div>
  
          {/* Call-to-Action */}
          <div className="text-center mt-4">
            <a
              href="#contact"
              className="bg-teal-500 text-white px-6 py-3 rounded-full hover:bg-teal-600 transition duration-300 ease-in-out"
            >
              Get in Touch
            </a>
          </div>
  
          {/* About Us Section */}
          <div id="about" className="p-6 mt-4">
            <h2 className="text-xl font-semibold text-teal-400 border-b-2 border-teal-500 pb-2">
              About Me
            </h2>
            <p className="mt-4 text-gray-700">
              I am a passionate web developer with over 5 years of experience in
              creating visually stunning and user-friendly websites. My goal is
              to deliver high-quality work while ensuring client satisfaction.
            </p>
          </div>
  
          {/* Social Media Links */}
          <div className="flex justify-center space-x-6 mt-4">
            {[
              { href: "#", iconClass: "fab fa-facebook", color: "blue-500" },
              { href: "#", iconClass: "fab fa-twitter-square", color: "blue-400" },
              { href: "#", iconClass: "fab fa-instagram", color: "pink-500" },
              { href: "#", iconClass: "fab fa-github", color: "gray-400" },
            ].map(({ href, iconClass, color }) => (
              <a
                key={iconClass}
                href={href}
                className={`text-${color} hover:text-${color.replace(
                  /-500$/,
                  "-400"
                )} transition transform hover:scale-110`}
              >
                <i className={iconClass + " fa-2x"}></i>
              </a>
            ))}
          </div>
  
          {/* Services Section */}
          <div id="services" className="p-6 mt-4">
            <h2 className="text-xl font-semibold text-teal-400 border-b-2 border-teal-500 pb-2">
              Services
            </h2>
            <div className="grid grid-cols-1 sm:grid-cols-2 gap-6 mt-6">
              {[
                { title: "Web Development", desc: "Websites tailored to your business needs." },
                { title: "UI/UX Design", desc: "Enhance user experience and retention." },
                { title: "SEO Optimization", desc: "Ranking and driving more organic traffic." },
                { title: "E-Commerce Solutions", desc: "Online stores to grow your business." },
              ].map(({ title, desc }, index) => (
                <div
                  key={index}
                  className="bg-white shadow-lg rounded-lg p-6 transform transition hover:scale-105"
                >
                  <h3 className="text-lg font-semibold text-gray-900">{title}</h3>
                  <p className="mt-2 text-gray-600">{desc}</p>
                </div>
              ))}
            </div>
          </div>
  
          {/* Gallery Section */}
          <div id="gallery" className="p-6 mt-4">
            <h2 className="text-xl font-semibold text-teal-400 border-b-2 border-teal-500 pb-2">
              Gallery
            </h2>
            <Swiper
              className="mt-4"
              slidesPerView={1}
              spaceBetween={10}
              loop
              autoplay={{ delay: 2500, disableOnInteraction: false }}
              pagination={{ clickable: true }}
              navigation
            >
              {[1, 2, 3, 4].map((_, index) => (
                <SwiperSlide key={index}>
                  <div className="rounded-lg overflow-hidden shadow-lg">
                    <img
                      src={`https://via.placeholder.com/800x500`}
                      alt={`Gallery ${index + 1}`}
                      className="w-full h-64 object-cover transform transition-all duration-500 hover:scale-105"
                    />
                  </div>
                </SwiperSlide>
              ))}
            </Swiper>
          </div>
        </div>
      </div>
    );
  };
  
  export default Header;
